import React from 'react';

const TableHead = (props) => {
    const {onSort}=props;
    return (
        <thead className="table-dark">
        <tr>
            <th className="fontifyr" onClick={()=>onSort()}>Title</th>
            <th className="fontifyr" onClick={()=>onSort()}>Genre</th>
            <th className="fontifyr" onClick={()=>onSort()}>Stock</th>
            <th className="fontifyr" onClick={()=>onSort()}>Rate</th>
            <th />
        </tr>
        </thead>
    );
};

export default TableHead;
